clcclearclc%% Definition of the omap objectEnv3D = occupancyMap3D;mapW = 100;mapL = 100;%% Introduce a defined number of obstaclesN=10;i=1;while i<=N    W=randi([1 50],1);     L=randi([1 50],1);     H=randi([1 150],1);     xP=randi([1 mapW],1);     yP=randi([1 mapL],1);     if xP+W<=mapW && yP+L<=mapL        [xO,yO,zO]=meshgrid(xP:xP+W,yP:yP+L,0:H);        Obstacle=[xO(:) yO(:) zO(:)];        Occupied=false;        StillNotFinished=true;        while ~Occupied && StillNotFinished            for j=1:size(Obstacle,1)                if checkOccupancy(Env3D,Obstacle(j,:))==1                    Occupied=true;                end            end            StillNotFinished=false;        end        if ~Occupied            setOccupancy(Env3D,Obstacle,1)            i=i+1;        end    endend%% Introduce the Ground as an obstacle in the omap[xG,yG,zG] = meshgrid(0:mapW,0:mapL,0);Ground = [xG(:) yG(:) zG(:)];setOccupancy(Env3D,Ground,1)%% Show the omap%show(Env3D)save("Env3D.mat")% TO OPEN A CREATED MAP% - LOAD THE .MAT FILE (E.G. mapData = load("Env3D_City.mat"); )% - OMAP=mapData.Env3D% - show(OMAP)